Jennie and Jill are a bonded pair that weigh about three and a half pounds each. They are both seniors and have no teeth so their diet consists mainly of wet/soft foods. They are working on going to the bathroom on potty pads, but do have accidents on the carpet from time to time. They need someone who is going to be patient in regards to potty training. Because they are seniors, they like to sleep a lot but get occasional spurts of energy throughout the day. The would do best in a home with someone who is home all day. 

All that being said, Jennie and Jill are absolutely wonderful. They love to cuddle. Jennie is more sassy and Jill more mellow. If you are interested in this bonded pair please fill out an application. 

Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the Greater Chicago Land area. Illinois only
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***

